    false,nt"url": null,nt"notes": "This narrative report details the conditions
    and management of Stillwater Wildlife Management Area from January through April
    of 1955.  The report begins with general information about weather and water conditions
    on the refuge.  The second section of the report describes wildlife on the refuge
    and includes migratory birds, upland game birds, fur animals, and fish.  The report
    then covers the refugeu2019s development and maintenance projects such as: physical
    development, plantings, and receipts of seed and nursery stock.  The fourth section
    of the report describes the economic uses of the refuge such as grazing and fur
    harvesting.  The last two sections of the report include information about field
    investigations, research, refuge visitors, and refuge participation.  Finally, descriptions
    of Anaho Island National Wildlife Refuge, Fallon National Wildlife Refuge, and Winnemucca
    National Wildlife Refuge are given.",nt"license_title": "License Not Specified",nt"extras":
